// src/Card.jsx
import React from 'react';
import './Card.css'; // Archivo de estilos
import CardChild from './CardChild';

const Card = ({ title }) => {
  return (
    <div className="card">
      <h2>{title}</h2>
      {CardChild}
    </div>
  );
};

export default Card;
